import { Grid, Stack, Typography } from "@mui/material";
import React from "react";
import IntroduceText from "../../components/IntroduceText";

import officeImage1 from "../../assets/img/partners/office1.png";
import officeImage2 from "../../assets/img/partners/office2.png";
import CustomBox from "../../components/CustomBox";
function Service() {
  return (
    <Grid
      container
      spacing={2}
      justifyContent="center"
      alignItems="center"
      mt={3}
    >
      <Grid item xs={12} lg={12}>
        <IntroduceText firstLine="파트너스" secondLine="서비스 소개" />
      </Grid>
      <Grid item xs={12} lg={12}>
        <img src={officeImage1} alt="" width="100%" />
      </Grid>
      <Grid item xs={12} lg={6}>
        <img src={officeImage2} alt="" width="100%" />
      </Grid>
      <Grid item xs={12} lg={6}>
        <CustomBox sx={{ textAlign: "left" }}>
          <Typography fontWeight={100}>
            BANTO PARTNER는 3가지 부류로 나뉘어져있습니다
          </Typography>
        </CustomBox>
        <CustomBox>
          <Stack direction="row" spacing={2}>
            <CustomBox
              sx={{
                width: 130,
                height: 130,
                borderRadius: "50%",
                background: "#FBFBFB",
                boxShadow: "0px 4px 4px rgba(0, 0, 0, 0.25)",
              }}
            >
              <Typography>세일즈</Typography>
            </CustomBox>
            <CustomBox
              sx={{
                width: 130,
                height: 130,
                borderRadius: "50%",
                background: "#FBFBFB",
                boxShadow: "0px 4px 4px rgba(0, 0, 0, 0.25)",
              }}
            >
              <Typography>구매자</Typography>
            </CustomBox>
            <CustomBox
              sx={{
                width: 130,
                height: 130,
                borderRadius: "50%",
                background: "#FBFBFB",
                boxShadow: "0px 4px 4px rgba(0, 0, 0, 0.25)",
              }}
            >
              <Typography>가맹점</Typography>
            </CustomBox>
          </Stack>
        </CustomBox>
        <CustomBox></CustomBox>
      </Grid>
      <Grid item xs={12} lg={12}></Grid>
    </Grid>
  );
}

export default Service;
